import React from 'react';
class Square extends React.Component {

    handle =(props)=>{
        this.props.fun(props.value)
    }
  render() {

    return (
      <button onClick={this.handle} className={`square`}>
            {this.props.kill}

      </button>
    );
  }
}
export default Square;
